import React from 'react';
import { Link } from 'react-router-dom'; 
import Products from './Products';

function App() {
  return (
    <div>
      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/products">Products</Link></li>
          <li><Link to="/contact-us">Contact Us</Link></li>
        </ul>
      </nav>
      <main>
        <Products />
      </main>
    </div>
  );
}

export default App;
